import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import { Formik, Field, Form, ErrorMessage } from "formik";
import * as Yup from "yup";
import { Container, Row, Col, Card, Button, Alert } from "react-bootstrap";
import AuthService from "../services/auth.service";

const Login = () => {
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");
  const navigate = useNavigate();

  const initialValues = {
    username: "",
    password: "",
  };

  const validationSchema = Yup.object().shape({
    username: Yup.string().required("Username is required"),
    password: Yup.string().required("Password is required"),
  });

  const handleLogin = (formValue) => {
    const { username, password } = formValue;
    setMessage("");
    setLoading(true);

    AuthService.login(username, password)
      .then(() => {
        navigate("/profile");
        window.location.reload();
      })
      .catch((error) => {
        const resMessage =
          (error.response &&
            error.response.data &&
            error.response.data.message) ||
          error.message ||
          error.toString();

        setLoading(false);
        setMessage(resMessage);
      });
  };

  return (
    <div className="auth-page">
      <Container className="auth-content">
        <Row className="justify-content-center">
          <Col md={6} lg={5}>
            <Card className="auth-card">
              <div className="auth-header">
                <h2>Welcome Back</h2>
                <p>Log in to continue your fitness journey</p>
              </div>

              <div className="auth-body">
                <Formik
                  initialValues={initialValues}
                  validationSchema={validationSchema}
                  onSubmit={handleLogin}
                >
                  {({ errors, touched }) => (
                    <Form>
                      <div className="form-group mb-3">
                        <label htmlFor="username" className="form-label">Username</label>
                        <Field
                          name="username"
                          type="text"
                          className={
                            "form-control" +
                            (errors.username && touched.username
                              ? " is-invalid"
                              : "")
                          }
                          placeholder="Enter your username"
                        />
                        <ErrorMessage
                          name="username"
                          component="div"
                          className="invalid-feedback"
                        />
                      </div>

                      <div className="form-group mb-3">
                        <div className="d-flex justify-content-between align-items-center">
                          <label htmlFor="password" className="form-label">Password</label>
                          <Link to="/forgot-password" className="text-decoration-none small">
                            Forgot Password?
                          </Link>
                        </div>
                        <Field
                          name="password"
                          type="password"
                          className={
                            "form-control" +
                            (errors.password && touched.password
                              ? " is-invalid"
                              : "")
                          }
                          placeholder="Enter your password"
                        />
                        <ErrorMessage
                          name="password"
                          component="div"
                          className="invalid-feedback"
                        />
                      </div>

                      <div className="form-group mt-4">
                        <Button
                          type="submit"
                          variant="primary"
                          className="w-100"
                          disabled={loading}
                        >
                          {loading ? (
                            <span className="spinner-border spinner-border-sm me-2"></span>
                          ) : (
                            <i className="fas fa-sign-in-alt me-2"></i>
                          )}
                          Login
                        </Button>
                      </div>

                      {message && (
                        <div className="form-group mt-3">
                          <Alert variant="danger">{message}</Alert>
                        </div>
                      )}
                    </Form>
                  )}
                </Formik>

                <div className="auth-divider">
                  <span>or continue with</span>
                </div>

                <div className="social-login">
                  <a href="#" className="social-btn google">
                    <i className="fab fa-google"></i>
                  </a>
                  <a href="#" className="social-btn facebook">
                    <i className="fab fa-facebook-f"></i>
                  </a>
                  <a href="#" className="social-btn twitter">
                    <i className="fab fa-twitter"></i>
                  </a>
                </div>

                <div className="auth-footer">
                  Don't have an account? <Link to="/register" className="text-decoration-none">Sign up now</Link>
                </div>
              </div>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Login;
